import React from 'react'
import PersonalInfo from './PersonalInfo'

function UserCard( {user}) {

const peronalComponent = user.map((u) => <PersonalInfo key={u.id} u={u} onClick={PersonalInfoDisplay} />
)

return (
    <div>
      <span class="material-icons">
        account_circle
      </span>
      <div> {peronalComponent}</div>
    </div>
  )
}

export default UserCard
